var mtiAdd=function(t){t.preventDefault();var e=$(t.currentTarget),i=e.parents(".mti-item"),m=i.clone(),n=e.parents(".mti");n.append(m),e.text("移除").removeClass("mti-add").addClass("mti-del")},mtiDel=function(t){t.preventDefault();var e=$(t.currentTarget);e.parents(".mti-item").remove()};jQuery(document).ready(function(t){t(".mti").on("click",".mti-add",mtiAdd),t(".mti").on("click",".mti-del",mtiDel)});